    int reflect_maplen(struct hmap* h)
    {
        if(h == nullptr)
        {
            return 0;
        }
        if(raceenabled)
        {
            auto callerpc = getcallerpc();
            racereadpc(unsafe::Pointer(h), callerpc, abi::FuncPCABIInternal(reflect_maplen));
        }
        return h->count;
    }

